import React, { useState } from "react";



function Card(character) {
  var { name } = character;
  var { powerlevel } = character;
  var { age } = character;
  return (
    <div className="Card">
     <div>Name: {name} </div>
    <div>Power Level: {powerlevel}</div>
     <div>Age: {age} </div>

    </div>
  );
}
 
export default Card;
